import "./App.css";
import Movie from "./components/Movie/Movie";
import { movies } from "./movieDummy";

function App() {
  return (
    <div className="App">
      <div className="movie_wrapper">
        {movies.results.map((item)=>(
              <Movie
                key={item.id}
                {...item}
              />
          ))}
      </div>
    </div>
  );
}

export default App;
